import Vue from 'vue'
Vue.component("demo-1", () => import("C:\\Users\\JYDel\\Documents\\glc-dgroups\\docs\\.vuepress\\components\\demo-1.vue"))
import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-48c8d6f0e1862",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("C:\\Users\\JYDel\\Documents\\glc-dgroups\\docs\\README.md").then(comp => {
        Vue.component("v-48c8d6f0e1862", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
